import React from 'react';
import { Link } from 'react-router-dom';

const Addactivity = () => {
  return (
    <>
      {/* Inline CSS สำหรับ hover */}
      <style>
        {`
          .nav-item {
            color: #003366;
            text-decoration: none;
            font-size: 16px;
            padding: 10px;
            line-height: 1.8;
            border-radius: 4px;
            transition: background-color 0.3s;
            display: block;
          }
          .nav-item:hover {
            background-color: #0077b6;
            color: #fff;
          }
          input, textarea {
            display: block;
            width: 100%;
            padding: 10px;
            margin-bottom: 15px;
            font-size: 16px;
            border: 1px solid #ccc;
            border-radius: 4px;
          }
          button {
            padding: 10px 20px;
            background-color: #0077b6;
            color: #fff;
            border: none;
            border-radius: 4px;
            cursor: pointer;
          }
        `}
      </style>

      {/* Main container */}
      <div style={styles.container}>
        
        {/* Top Box (Header) */}
        <div style={styles.topBox}>
          <h2>เพิ่มกิจกรรมใหม่</h2>
          <p>กรอกข้อมูลกิจกรรมที่จะเพิ่มเข้าสู่ระบบ</p>
        </div>

        {/* Main content container */}
        <div style={styles.mainContent}>
          {/* Left Side (Menu) */}
          <div style={styles.leftSide}>
            <header style={styles.header}>
              <nav style={styles.nav}>
                <Link to="/hometeacher" style={styles.navItem}>หน้าหลัก</Link>                
                <Link to="/profile" style={styles.navItem}>โปรไฟล์</Link>           
                <Link to="/searchactivityteacher" style={styles.navItem}>ค้นหากิจกรรม</Link> 
                <Link to="/followactivityteacher" style={styles.navItem}>กิจกรรมที่ติดตาม</Link> 
                <Link to="/addactivity" style={styles.navItem}>เพิ่มกิจกรรม</Link>
                {/* เพิ่มลิงก์ที่ "ออกจากระบบ" เพื่อไปหน้า Login */}
                <Link to="/" style={styles.navItem}>ออกจากระบบ</Link> </nav>
            </header>
          </div>

          {/* Right Side (Main content) */}
          <div style={styles.rightSide}>
            <section style={styles.mainSection}>
              <h3 style={styles.sectionTitle}>ฟอร์มเพิ่มกิจกรรม</h3>

              <form>
                <input type="text" placeholder="ชื่อกิจกรรม" required />
                <input type="date" placeholder="วันที่จัดกิจกรรม" required />
                <input type="text" placeholder="สถานที่" required />
                <input type="number" placeholder="จำนวนชั่วโมง" required min="1" />
                <textarea placeholder="รายละเอียดกิจกรรมเพิ่มเติม" rows="4"></textarea>
                <button type="submit">บันทึกกิจกรรม</button>
              </form>
            </section>
          </div>
        </div>

        {/* Bottom Box (Footer) */}
        <div style={styles.bottomBox}>
          <p>ติดต่อเรา: example@domain.com</p>
        </div>
      </div>
    </>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
  },
  topBox: {
    backgroundColor: '#003366',
    padding: '20px',
    textAlign: 'center',
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
    flex: '0 1 100px',
    color: '#fff',
  },
  mainContent: {
    display: 'flex',
    flex: 1,
    backgroundColor: '#f9f9f9',
  },
  leftSide: {
    width: '250px',
    backgroundColor: '#A1D8E6',
    padding: '20px',
    color: '#003366',
  },
  header: {
    marginBottom: '30px',
  },
  nav: {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px',
  },
  rightSide: {
    flex: 1,
    padding: '20px',
    overflowY: 'auto',
  },
  mainSection: {
    backgroundColor: 'white',
    padding: '20px',
    borderRadius: '8px',
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
  },
  sectionTitle: {
    fontSize: '24px',
    marginBottom: '20px',
    color: '#003366',
  },
  bottomBox: {
    backgroundColor: '#003366',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
    flex: '0 1 100px',
  },
};

export default Addactivity;
